name: üíé Yex Enterprise Gold Delivery (1MB Edition)

on:
  push:
    branches: [ main, master ]
  release:
    types: [published]
  workflow_dispatch:

concurrency:
  group: ${{ github.workflow }}-${{ github.ref }}
  cancel-in-progress: true

jobs:
  quality-assurance:
    name: üõ°Ô∏è QA & Security Shield
    runs-on: ubuntu-latest
    steps:
      - uses: actions/checkout@v4
      - name: Setup Node.js v20
        uses: actions/setup-node@v4
        with:
          node-version: 20
          cache: 'npm'
      - name: Install Dependencies
        run: npm ci
      - name: Yex Security Audit
        run: |
          echo "Running Yex Shield Security Analysis..."
          node core/security.shield.js --audit

  build-and-test:
    name: üèóÔ∏è Build Symbolic Engine
    needs: quality-assurance
    runs-on: ubuntu-latest
    steps:
      - uses: actions/checkout@v4
      - uses: actions/setup-node@v4
        with:
          node-version: 20
      - name: Compile Yex AST
        run: npm run build

  publish-github:
    name: üì¶ Publish to GitHub Packages
    if: github.event_name == 'release'
    needs: build-and-test
    runs-on: ubuntu-latest
    permissions:
      contents: read
      packages: write
    steps:
      - uses: actions/checkout@v4
      - uses: actions/setup-node@v4
        with:
          node-version: 20
          registry-url: 'https://npm.pkg.github.com'
      - name: Publish
        run: npm publish
        env:
          NODE_AUTH_TOKEN: ${{ secrets.GITHUB_TOKEN }}
